:20220920T005715Z\r\nDESCRIPTION:<html-blob><u></u><i>This calendar invite is going to all new \r\n CS grad students. If you already have a key from a previous quarter (if \r\n BS/MS student or you arrived early) and already have these keys checked \r\n out\\, you may disregard.&nbsp\\;</i><u></u><br><br><u></u>September 22 \r\n from 9am-12pm and 1pm-4pm will be reserved for staff to distribute keys \r\n to the new CS grad students. Appointments are not needed on this \r\n day.&nbsp\\;<br><u></u><br><u></u>While the event is listed 9am-4pm \r\n <b><u>we will close for lunch at 12pm</u></b> (it is typical for campus \r\n staff offices to be closed 12-1pm for a lunch break).&nbsp\\;\r\n <u></u><br><br><u></u>The following sets of new grad students will be \r\n eligible to check out CS-specific keys on this day:&nbsp\\;\r\n <u></u><br><ol><li><u></u><b>New PhD students</b>\\, for research lab \r\n space: faculty received an email on Sept 13 titled "<u></u><span>Research \r\n Lab Keys" with instructions for them to give permission to Bella for \r\n research lab key checkout\\,&nbsp\\;</span><span>please have your faculty \r\n member email <a href="mailto:\r\n cs-gradprogram@ucsb.edu">cs-gradprogram@ucsb.edu</a> in order to document \r\n their permission regarding access to their research lab.&nbsp\\;\r\n </span></li><li><span><b>New students</b>&nbsp\\;<b>assigned to TA for a \r\n course that is using Phelps 3525</b> for CS lab sections. Bella will have \r\n the list of TAs specifically eligible for a key to the CS Phelps \r\n Instructional Lab.&nbsp\\;</span></li><li><span><b>New students</b>&nbsp\\;\r\n <b>assigned to TA for any course</b> where they would like to use the CS \r\n TA Trailer\\, Trailer 936. Bella will have the list of TAs to verify their \r\n eligibility for the TA Trailer key.&nbsp\\;</span></li></ol><span>Note \r\n that new this year\\, we are <b><u>not</u></b> handing out physical keys \r\n to the CS Graduate Lounge. You will have a separate electronic key access \r\n and more information on this will be sent by next week.&nbsp\\;\r\n </span><span><br></span><br><span>If you cannot or do not attend this key \r\n day and you are in one of the categories above that needs a key\\, please \r\n make a separate appointment on another day for key checkout at:&nbsp\\;\r\n </span><a href="https:\r\n //calendly.com/ucsb-cs-dept/graduate-student-key-check-out">https:\r\n //calendly.com/ucsb-cs-dept/graduate-student-key-check-out</a><br><span><b\r\n r></span></html-blob>\r\nLAST-MODIFIED:20220922T045200Z\r\nLOCATION:Harold Frank Hall (HFH) Room 2112\r\nSEQUENCE:0\r\nSTATUS:CONFIRMED\r\nSUMMARY:CS New Grad Student Key Check-out Day\r\nTRANSP:OPAQUE\r\nX-EVOLUTION-CALDAV-ETAG:63799505520\r\nBEGIN:VALARM\r\nACTION:DISPLAY\r\nDESCRIPTION:This is an event reminder\r\nTRIGGER:-PT10M\r\nX-EVOLUTION-ALARM-UID:60c06dda11a831c064bc2a774cda851675ee8bda\r\nEND:VALARM\r\nEND:VEVENT\r\n', 'e5d00f98f3d5451b59eb8f517811982683d1acd4\n9070856c81597d723c121e65ea414a4afc925578\t20220920T193000\n1663726800\n1663727400\n1663731000\nBEGIN:VEVENT\r\nDTSTART;TZID=America/Los_Angeles:20220913T193000\r\nDTEND;TZID=America/Los_Angeles:20220913T203000\r\nRRULE:FREQ=WEEKLY;UNTIL=20221019T065959Z;BYDAY=TU;WKST=SU\r\nDTSTAMP:20220913T173445Z\r\nORGANIZER;CN=yujielu@ucsb.edu:mailto:yujielu@ucsb.edu\r\nUID:44gsi5eqo0v1jbgva048tkem0j_R20220914T023000@google.com\r\nATTENDEE;CUTYPE=INDIVIDUAL;ROLE=REQ-PARTICIPANT;PARTSTAT=ACCEPTED;\r\n CN=ete@ucsb.edu;X-NUM-GUESTS=0:mailto:ete@ucsb.edu\r\nATTENDEE;CUTYPE=INDIVIDUAL;ROLE=REQ-PARTICIPANT;PARTSTAT=ACCEPTED;\r\n CN=yujielu@ucsb.edu;X-NUM-GUESTS=0:mailto:yujielu@ucsb.edu\r\nCREATED:20220710T015135Z\r\nDESCRIPTION:Join Zoom Meeting\\nhttps:\r\n //ucsb.zoom.us/j/86780676931?pwd=NHJodDRseTJtamRvOG9JVnpKMEtvdz09\r\nLAST-MODIFIED:20220913T173445Z\r\nX-LIC-ERROR;X-LIC-ERRORTYPE=VALUE-PARSE-ERROR:No value for LOCATION \r\n property. Removing entire property:\r\nSEQUENCE:2\r\nSTATUS:CONFIRMED\r\nSUMMARY:RL-Eddie\r\nTRANS